import React from "react";

const Home = () => {
  return (
    <div className="header-image">
      <figure>
        <img src="https://s3-us-west-2.amazonaws.com/s.cdpn.io/3/sun.svg" />
      </figure>
    </div>
  );
};

export default Home;
